import { Fragment } from "react";
import React from "react";
import Navbar from "./Navbar";
function Cart() {
  return (
    <Fragment>
      <header>
        <Navbar></Navbar>
      </header>
      <div className="p-3" />
      <div className="flex justify-center text-5xl">Cart</div>
    </Fragment>
  );
}

export default Cart;
